import { useState, useEffect } from "react";
import CompanyModal from "../../Common/CompanyModal";
import LoanIconButton from "../../../Common/LoanIconButton";
import { BsPlus } from "react-icons/bs";
import { IconButton } from "@material-tailwind/react";
import {
  InputLabel,
  TextField,
  MenuItem,
  FormControl,
  Select,
} from "@mui/material";
import CommonServices from "../../Common/CommonServices";
const EditMarriedStatus = ({ SoleId }) => {
  //starts married edit
  const [toggleEditMarriedInfo, setToggleEditMarriedInfo] = useState(false);
  const [submitted, setSubmitted] = useState(false);
  const [country, setContry] = useState([]);
  const [MarriedId, setMarriedId] = useState([]);
  const [proofOfIdentityType, setProofOfIdentityType] = useState([]);
  setMarriedId(SoleId);
  alert(SoleId)
  const [editMarriedInfo, setEditMarriedInfo] = useState({
    Id: SoleId,
    FirstName: "",
    MiddleName: "",
    LastName: "",
    NationalityID: "",
    CountryOfOriginID: "",
    CountryOfResidenceID: "",
    ProofOfIdentityTypeID: "",
    ProofOfIdentity: "",
    MarriageDate: "",
    MarriageCertificate: "",
    MarriageCertificateIssuer: "",
    ProofOfIdentityIssueDate: "",
    ProofOfIdentityExpirDate: "",
  });
  const updateMarriedById = () => {
    CommonServices.getMarried(SoleId)
      .then((res) => {
        setEditMarriedInfo({
          ...editMarriedInfo,
          Id: SoleId,
          FirstName: res.data.Result.FirstName,
          MiddleName: res.data.Result.MiddleName,
          LastName: res.data.Result.LastName,
          NationalityID: res.data.Result.NationalityID,
          CountryOfOriginID: res.data.Result.CountryOfOriginID,
          CountryOfResidenceID: res.data.Result.CountryOfResidenceID,
          ProofOfIdentityTypeID: res.data.Result.ProofOfIdentityTypeID,
          ProofOfIdentity: res.data.Result.ProofOfIdentity,
          MarriageDate: res.data.Result.MarriageDate,
          MarriageCertificate: res.data.Result.MarriageCertificate,
          MarriageCertificateIssuer: res.data.Result.MarriageCertificateIssuer,
          ProofOfIdentityIssueDate: res.data.Result.ProofOfIdentityIssueDate,
          ProofOfIdentityExpirDate: res.data.Result.ProofOfIdentityExpirDate,
        });
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    updateMarriedById();
  }, []);
  const handleInputChangeEditMarriedStatus = (event) => {
    const { name, value } = event.target;
    setEditMarriedInfo({ ...editMarriedInfo, [name]: value });
  };

  const updateMarriedInfo = () => {
    CommonServices.updateMarried(SoleId, editMarriedInfo)
      .then((response) => {})
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    updateMarriedInfo();
  }, []);
  const fetchContry = () => {
    CommonServices.getCountry()
      .then((response) => {
        setContry(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchContry();
  }, []);

  const fetchProofOfIdentityType = () => {
    CommonServices.getProofOfIdentityTypes()
      .then((response) => {
        setProofOfIdentityType(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchProofOfIdentityType();
  }, []);
  return (
    <>
      <button
        onClick={() => setToggleEditMarriedInfo(!toggleEditMarriedInfo)}
        className="text-purple-600 rounded-md font-medium "
      >
        Edit Married
      </button>
      <div>
        {toggleEditMarriedInfo && (
          <div className="submit-form">
            {submitted ? (
              <div>
                <h4>You submitted successfully!</h4>
              </div>
            ) : (
              <div>
                {SoleId}
                <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                  {/* <TextField
                  id="FirstName"
                  label="FirstName"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.FirstName}
                  onChange={(e) =>
                    setEditMarriedInfo({ 
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="FirstName"
                /> */}
                  <TextField
                    id="FirstName"
                    label="FirstName"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={editMarriedInfo.FirstName}
                    onChange={handleInputChangeEditMarriedStatus                    
                    }
                    name="FirstName"
                  />
                  <TextField
                    id="MiddleName"
                    label="MiddleName"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={editMarriedInfo.MiddleName}
                    onChange={handleInputChangeEditMarriedStatus}
                    name="MiddleName"
                  />
                  {/* <TextField
                  id="MiddleName"
                  label="MiddleName"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.MiddleName}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="MiddleName"
                /> */}
                  {/* <TextField
                  id="LastName"
                  label="LastName"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.LastName}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="LastName"
                /> */}
                  <TextField
                    id="LastName"
                    label="LastName"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={editMarriedInfo.LastName}
                    onChange={handleInputChangeEditMarriedStatus}
                    name="LastName"
                  />
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Nationality{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (editMarriedInfo.NationalityID = event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {country.map((yourCounty) => (
                        <MenuItem
                          key={yourCounty.Id}
                          NationalityID={yourCounty.Id}
                          value={yourCounty.Id}
                        >
                          {yourCounty.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Country Of Origin{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (editMarriedInfo.CountryOfOriginID = event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {country.map((yourCounty) => (
                        <MenuItem
                          key={yourCounty.Id}
                          NationalityID={yourCounty.Id}
                          value={yourCounty.Id}
                        >
                          {yourCounty.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Country Of Residence{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (editMarriedInfo.CountryOfResidenceID =
                          event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {country.map((yourCounty) => (
                        <MenuItem
                          key={yourCounty.Id}
                          NationalityID={yourCounty.Id}
                          value={yourCounty.Id}
                        >
